.navbar {
    color: #fff;
    z-index: 1002;
    height: 60px;
    display:block;
    background-color: #0054a6;
    filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#ffffffff', endColorstr='#fff2f2f2', GradientType=0);
    box-shadow: 0 0px 6px rgba(0, 0, 0, 0.6);
}

.navbar-inner {
    width: 960px;
    display: block;
    margin-right: auto;
    margin-left: auto;
    z-index: 1002;
    height: 80px;
}

.navbar-inner a.brand {
    position: relative;
    display:inline-block;
    font-size: 18px;
    font-weight: bold;
    float: left;
    z-index: 1002;
