    left: 0;
    float: right;
    font-size: 18px;
}

.navbar-inner ul li {
    padding-left: 14px;
    display: inline-block;
}

.navbar-inner ul li a {
    display: inline-block;
}

.navbar-inner ul li a:hover {
    color: #fff;
}

.navbar-inner .logout-item.pull-right {
    float: none;
}

